import React from 'react';
import { useSelector } from 'react-redux';
import { RootState } from '../store/store'; // Import RootState
//import '../styles/CarList.scss';

const CarList: React.FC = () => {
  // Użyj właściwości `availableCars`, a nie `cars`
  const availableCars = useSelector((state: RootState) => state.cars.availableCars);

  return (
    <div>
      <h2>Available Cars</h2>
      <ul>
        {availableCars.map((car: { id: number; type: string; available: boolean }) => (  // Określenie typu obiektu 'car'
          <li key={car.id}>
            {car.type} {car.available ? '(Available)' : '(Not Available)'}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CarList;
